function chooseWord(data) {

    var wordChoosingArray = createNonRandomNumbers(data);
    var idx = Math.floor(Math.random() * wordChoosingArray.length);
    var chosenWordIdx = wordChoosingArray[idx];
    var chosenWord = data.words[chosenWordIdx];

    return chosenWord;
}


function chooseGrammar(data) {

    var grammarChoosingArray = createNonRandomNumbers(data);
    var idx = Math.floor(Math.random() * grammarChoosingArray.length);
    var chosenGrammarIdx = grammarChoosingArray[idx];
    var chosenGrammar = data.grammar[chosenGrammarIdx];

    return chosenGrammar.split('_');
}


function createNonRandomNumbers(data) {

    var nData = Object.keys(data.freqs).length;
    console.log(nData);
    var smallestFreq = data.freqs[nData - 1];
    var arrayLength = Math.ceil(1 / smallestFreq);

    var runLength = 0;
    var nonRandomArray = [];

    for (var i = 0; i < nData; i++) {
        runLength = Math.round(data.freqs[i] * arrayLength);
        for (var j = 0; j < runLength; j++) {
            nonRandomArray.push(i);
        }
    }

    return nonRandomArray;
}

